        public IMunicipality GetMunicipality(int id, int year)
        {
            if(_municipalities.TryGetValue(GenerateKey(id, year), out var municipality))
            {
                return municipality;
            }

            throw new ArgumentOutOfRangeException(nameof(id), $"Unable to find municipality ({id}) in {year}");
        }

        private int ExtractYearFromFilename(string sourceFileName)
        {
            var regEx = new Regex(@"(\d{4})", RegexOptions.IgnoreCase);
            
            return Convert.ToInt32(regEx.Matches(sourceFileName)[0].Value);
        }

        private string GenerateKey(int municipalityCode, int year)
        {
            return $"{year}_{municipalityCode}";
        }
    }
